import React, { useState } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { Plus, Car, Edit, Trash2, DollarSign, Calendar, Gauge } from 'lucide-react';
import { useApp } from '../../context/AppContext.tsx';
import { Vehicle } from '../../types/index.ts';
import { VehicleForm } from './VehicleForm.tsx';

export function GarageView() {
  const { state, deleteVehicle } = useApp();
  const [selectedVehicle, setSelectedVehicle] = useState<Vehicle | null>(null);
  const [showAddForm, setShowAddForm] = useState(false);

  const handleDeleteVehicle = (vehicleId: string) => {
    if (window.confirm('Are you sure you want to delete this vehicle?')) {
      deleteVehicle(vehicleId);
    }
  };

  return (
    <div className="space-y-6">
      {/* Header */}
      <div className="flex items-center justify-between">
        <div>
          <h1 className="text-3xl font-bold text-primary-100">My Garage</h1>
          <p className="text-primary-300 mt-1">Manage your vehicle inventory</p>
        </div>
        <motion.button
          whileHover={{ scale: 1.02 }}
          whileTap={{ scale: 0.98 }}
          onClick={() => setShowAddForm(true)}
          className="btn-primary flex items-center space-x-2"
        >
          <Plus className="w-5 h-5" />
          <span>Add Vehicle</span>
        </motion.button>
      </div>

      {/* Vehicle Grid */}
      {state.vehicles.length === 0 ? (
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          className="text-center py-16"
        >
          <div className="w-24 h-24 bg-primary-800/50 rounded-full flex items-center justify-center mx-auto mb-4">
            <Car className="w-12 h-12 text-primary-400" />
          </div>
          <h3 className="text-xl font-semibold text-primary-200 mb-2">No vehicles yet</h3>
          <p className="text-primary-400 mb-6">Add your first vehicle to get started</p>
          <motion.button
            whileHover={{ scale: 1.02 }}
            whileTap={{ scale: 0.98 }}
            onClick={() => setShowAddForm(true)}
            className="btn-primary"
          >
            Add Your First Vehicle
          </motion.button>
        </motion.div>
      ) : (
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
          <AnimatePresence>
            {state.vehicles.map((vehicle, index) => (
              <motion.div
                key={vehicle.id}
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                exit={{ opacity: 0, scale: 0.9 }}
                transition={{ delay: index * 0.1 }}
                className="glass-effect rounded-xl p-6 hover:shadow-xl transition-all duration-300"
              >
                {/* Vehicle Image Placeholder */}
                <div className="w-full h-48 bg-gradient-to-br from-secondary-100 to-secondary-200 rounded-lg mb-4 flex items-center justify-center">
                  <Car className="w-16 h-16 text-secondary-400" />
                </div>

                {/* Vehicle Info */}
                <div className="space-y-3">
                  <div>
                    <h3 className="text-xl font-bold text-secondary-800">
                      {vehicle.year} {vehicle.make} {vehicle.model}
                    </h3>
                    <p className="text-secondary-600 capitalize">{vehicle.color} • {vehicle.bodyType}</p>
                  </div>

                  <div className="flex items-center justify-between text-sm text-secondary-600">
                    <div className="flex items-center space-x-1">
                      <Gauge className="w-4 h-4" />
                      <span>{vehicle.mileage.toLocaleString()} mi</span>
                    </div>
                    <div className="flex items-center space-x-1">
                      <Calendar className="w-4 h-4" />
                      <span>{vehicle.year}</span>
                    </div>
                  </div>

                  <div className="flex items-center justify-between">
                    <div className="flex items-center space-x-1">
                      <DollarSign className="w-5 h-5 text-green-600" />
                      <span className="text-lg font-bold text-green-600">
                        ${(vehicle.customPrice || vehicle.estimatedValue).toLocaleString()}
                      </span>
                    </div>
                    <span className={`px-2 py-1 rounded-full text-xs font-medium ${
                      vehicle.condition === 'excellent' ? 'bg-green-100 text-green-700' :
                      vehicle.condition === 'good' ? 'bg-blue-100 text-blue-700' :
                      vehicle.condition === 'fair' ? 'bg-yellow-100 text-yellow-700' :
                      'bg-red-100 text-red-700'
                    }`}>
                      {vehicle.condition}
                    </span>
                  </div>

                  {/* Action Buttons */}
                  <div className="flex space-x-2 pt-2">
                    <motion.button
                      whileHover={{ scale: 1.02 }}
                      whileTap={{ scale: 0.98 }}
                      onClick={() => setSelectedVehicle(vehicle)}
                      className="flex-1 btn-secondary flex items-center justify-center space-x-1"
                    >
                      <Edit className="w-4 h-4" />
                      <span>Edit</span>
                    </motion.button>
                    <motion.button
                      whileHover={{ scale: 1.02 }}
                      whileTap={{ scale: 0.98 }}
                      onClick={() => handleDeleteVehicle(vehicle.id)}
                      className="px-3 py-2 bg-red-100 hover:bg-red-200 text-red-600 rounded-lg transition-colors"
                    >
                      <Trash2 className="w-4 h-4" />
                    </motion.button>
                  </div>
                </div>
              </motion.div>
            ))}
          </AnimatePresence>
        </div>
      )}

      {/* Vehicle Form Modal */}
      <AnimatePresence>
        {showAddForm && (
          <VehicleForm
            onClose={() => setShowAddForm(false)}
          />
        )}
        {selectedVehicle && (
          <VehicleForm
            vehicle={selectedVehicle}
            onClose={() => setSelectedVehicle(null)}
          />
        )}
      </AnimatePresence>
    </div>
  );
}
